import { useNavigate } from 'react-router-dom';

function HomePage() {
  const navigate = useNavigate();
  return (
    <div className="HomePage">
      <h1>Welcome to Freelancer UI</h1>
      <button onClick={() => navigate('/create')}>Create New Freelancer</button>
    </div>
  );
}

export default HomePage;
